Hole, The (2009)  

Verenigde Staten
Thriller
98 minuten

geregisseerd door Joe Dante
met Chris Massoglia, Haley Bennett en Nathan Gamble

Susan verhuist met haar twee tienerzoons naar een landelijk huis. Wanneer de twee broers in de kelder een geheime deur ontdekken, welk naar een donker, bodemloos hol leidt, realiseren ze zich dat het een doorgang is naar hun duisterste nachtmerries en angsten.

